// Portable Big-Endian Write
void write_u64_be(uint8_t *dst, uint64_t val) {
dst[0] = (uint8_t)(val >> 56);
dst[1] = (uint8_t)(val >> 48);
dst[2] = (uint8_t)(val >> 40);
dst[3] = (uint8_t)(val >> 32);
dst[4] = (uint8_t)(val >> 24);
dst[5] = (uint8_t)(val >> 16);
dst[6] = (uint8_t)(val >> 8);
dst[7] = (uint8_t)(val >> 0);
}
